CONSTRUCT {
?director <http://purl.org/dc/terms/subject>
<http://dbpedia.org/resource/Category:Video_games> .
?director foaf:name ?name .
}WHERE{
?director <http://purl.org/dc/terms/subject>
<http://dbpedia.org/resource/Category:Video_games> .
?director foaf:name ?name .
} LIMIT 1000

