PREFIX dbo: <http://dbpedia.org/ontology/>

CONSTRUCT {
?person <http://purl.org/dc/terms/subject>
<http://dbpedia.org/resource/Category:Biologists> .
?person dbo:deathDate ?death .
?person foaf:name ?name .
}WHERE{
?person <http://purl.org/dc/terms/subject>
<http://dbpedia.org/resource/Category:Biologists> .
?person dbo:deathDate ?death .
?person foaf:name ?name .
FILTER (?death >=2007) .
} LIMIT 1000

